INSERT INTO fh.t_notice_dict (notice_id,notice_title,notice_desc,notice_publisher,notice_keyword,insert_time,publisher_id) VALUES ('2018214221309433','“与经典诗文同行”读书心得征文比赛','为营造良好的校园文化气氛，陶冶大学生情操，引导读者走进图书馆，培养大学生爱读书、读好书的热情，积极构建书香校园，作为第八届读书月系列活动之一，图书馆举办“与经典诗文同行””读书心得征文比赛活动。','挪威的森林2','最新公告','2018-03-15 13:33:21.000','1');
